            for (var i=1;i<k;i++) {
              var q = i/(k);
              var idx = Math.floor(q*(arr.length-1));
              res.push(arr[idx]);
            }
            return Array.from(new Set(res));
          }

          function ramp(i, n) {
            var h=220, s=70, lMin=92, lMax=45;
            var l = lMin - (i*(lMin-lMax)/(Math.max(1,n-1)));
            return "hsl("+h+", "+s+"%,"+l+"%)";
          }

          function getPoly() {
            var poly = window[polyVarName] || null;
            if (poly && poly.eachLayer) return poly;
            if (mapObj && mapObj._layers) {
              for (var k in mapObj._layers) {
                var l = mapObj._layers[k];
                if (l && l.eachLayer && l.toGeoJSON) return l;
              }
            }
            return null;
          }

          function renderClassLegend(breaks) {
            var out = document.getElementById('cls-legend');
            if (!out) return;
            if (!choroplethOn || !breaks || !breaks.length) { out.innerHTML = "<div class='muted tiny'>Choropleth off</div>"; return; }
            var html = "<div class='section-title'>DMA total spend</div>";
            var n = breaks.length+1;
            for (var i=0;i<n;i++) {
              var lo = i===0 ? 0 : breaks[i-1];
              var hi = i===breaks.length ? "max" : breaks[i];
              var sw = ramp(i, n);
              var rng = i===breaks.length ? fmtMoney(lo)+"+" : fmtMoney(lo)+"–"+fmtMoney(hi);
              html += "<div class='row-flex'><span class='sw' style='background:"+sw+"'></span><span class='tiny'>"+rng+"</span></div>";
            }
            out.innerHTML = html;
          }

          function updateChoropleth(weekStr) {
            var poly = getPoly();
            if (!poly) return;
            var totals = collectDMATotals(weekStr);
            var breaks = computeBreaks(totals, 5);
            var n = breaks.length+1;
            poly.eachLayer(function(lyr){
              var name = lyr && lyr.feature && lyr.feature.properties && (lyr.feature.properties.dma_name || lyr.feature.properties.DMA_NAME) || null;
              var v = name && totals[name] ? totals[name] : 0;
              var idx = 0; for (var i=0;i<breaks.length;i++) if (v>breaks[i]) idx=i+1;
              var fill = v>0 ? ramp(idx, n) : "hsl(220,15%,97%)";
              if (choroplethOn) {
                lyr.setStyle({fillColor:fill, fillOpacity: 0.35, color:"#334155", weight:1});
              } else {
                lyr.setStyle({fillColor:"#7aa6ff", fillOpacity:0.18, color:"#333", weight:1});
              }
            });
            renderClassLegend(breaks);
          }

          var bar = L.control({position:'bottomleft'});
          bar.onAdd = function(map) {
            var div = L.DomUtil.create('div');
            div.className = "ctrl-card";
            div.innerHTML =
                "<div class='ctrl-row'>"
              + "<h4>Week</h4>"
              + "<div class='right'>"
              + "<button id='play-toggle' class='pill-btn' title='Play/Pause'>Play</button>"
              + "<button id='labels-toggle' class='pill-btn active' title='Show/Hide DMA labels'>Labels</button>"
              + "<button id='choro-toggle' class='pill-btn active' title='Toggle choropleth'>Fill</button>"
              + "</div>"
              + "</div>"
              + "<div class='ctrl-row' style='margin-top:6px'>"
              + "<input id='wk-slider' type='range' min='0' max='"+(weekLabels.length-1)+"' step='1' value='0' style='width:100%'>"
              + "</div>"
              + "<div class='row-flex' style='margin-top:6px'><span class='tiny'>Selected week</span><span id='wk-readout' class='hl' style='margin-left:auto'></span></div>";
            return div;
          };
          bar.addTo(mapObj);

          var panel = L.control({position:'topright'});
          panel.onAdd = function(map) {
            var div = L.DomUtil.create('div','ctrl-card');
            div.style.maxHeight = '60vh';
            div.style.overflow = 'auto';
            div.style.minWidth = '320px';
            div.innerHTML =
                "<h4>Missouri GOP Primary – Weekly Spend</h4>"
              + "<div id='kpi' style='margin-bottom:8px'></div>"
              + "<div class='section-title'>Totals by source (All DMAs)</div>"
              + "<div id='legend-all' style='margin-bottom:8px'></div>"
              + "<div id='cls-legend' class='cls-legend'></div>"
              + "<div class='section-title'>Breakdown</div>"
              + "<div class='tiny' style='margin-bottom:4px'><b>DMA:</b> <span id='dma-lbl'>All</span></div>"
              + "<table id='tbl-sources' class='legend-table'></table>"
              + "<div style='margin-top:8px'><button id='reset-dma' class='pill-btn'>Reset DMA</button></div>";
            return div;
          };
          panel.addTo(mapObj);

          var cumPanel = L.control({position:'topleft'});
          cumPanel.onAdd = function(map) {
            var div = L.DomUtil.create('div','ctrl-card');
            div.style.minWidth = '280px';
            div.innerHTML =
              "<h4>Cumulative to date</h4>"
            + "<div class='tiny' id='cum-total' style='margin-bottom:6px'></div>"
            + "<div id='cum-legend'></div>";
            return div;
          };
          cumPanel.addTo(mapObj);

          function renderCumulative(idx) {
            var total = 0;
            var agg = {};
            for (var i=0;i<=idx;i++) {
              var wk = weekLabels[i];
              var all = (DATA[wk] && DATA[wk]["__ALL__"]) ? DATA[wk]["__ALL__"] : null;
              if (!all) continue;
              Object.keys(all).forEach(function(k) {
                agg[k] = (agg[k]||0) + (all[k]||0);
                total += (all[k]||0);
              });
            }
            var tDiv = document.getElementById('cum-total');
            if (tDiv) tDiv.innerHTML = "<b>Total:</b> "+fmtMoney(total);
            var lDiv = document.getElementById('cum-legend');
            if (lDiv) lDiv.innerHTML = buildLegendRows(agg, 15);
          }

          function renderBreakdownDMA(weekStr) {
            var tgtName = selectedDMA || "__ALL__";
            var dict = (DATA[weekStr] && DATA[weekStr][tgtName]) ? DATA[weekStr][tgtName] : null;
            var T = document.getElementById('tbl-sources');
            var lbl = document.getElementById('dma-lbl');
            if (lbl) lbl.textContent = selectedDMA ? selectedDMA : "All";
            if (!T) return;
            var entries = dict ? Object.entries(dict) : [];
            entries.sort(function(a,b){return b[1]-a[1]});
            if (entries.length > 15) entries = entries.slice(0, 15);
            var total = entries.reduce(function(s,p){return s+(p[1]||0)},0);
            var html = "<thead><tr><th>Advertiser Trunc</th><th class='amt'>Amount</th></tr></thead><tbody>";
            if (!entries.length) html += "<tr><td colspan='2' class='muted'>No data</td></tr>";
            entries.forEach(function(p){ var c=hashColor(p[0]); html += "<tr><td><span class='sw' style='background:"+c+"'></span>"+p[0]+"</td><td class='amt'>"+fmtMoney(p[1])+" <span class='tiny'>"+(total? Math.round((p[1]/total)*100):0)+"%</span></td></tr>"; });
            html += "</tbody>";
            T.innerHTML = html;
          }

          function renderAll(weekIdx) {
            var weekStr = weekLabels[weekIdx] || '';
            var wk = document.getElementById('wk-readout'); if (wk) wk.textContent = weekStr;
            renderKPI(weekStr);
            renderLegendAll(weekStr);
            renderBreakdownDMA(weekStr);
            renderLabels(weekStr);
            updateChoropleth(weekStr);
            renderCumulative(weekIdx);
          }

          function showWeek(idx) { renderAll(idx); }

          function getPolyAndWire() {
            var poly = getPoly();
            if (!poly) { setTimeout(getPolyAndWire, 120); return; }
            poly.eachLayer(function(lyr) {
              lyr.on('click', function(ev) {
                try {
                  selectedDMA = (ev && ev.target && ev.target.feature && ev.target.feature.properties && (ev.target.feature.properties.dma_name || ev.target.feature.properties.DMA_NAME)) || null;
                } catch(e) { selectedDMA = null; }
                var slider = document.getElementById('wk-slider');
                var idx = slider ? parseInt(slider.value, 10) : 0;
                renderAll(idx);
              });
            });
          }
          getPolyAndWire();

          function initUI() {
            var slider = document.getElementById('wk-slider');
            if (!slider) { setTimeout(initUI, 60); return; }
            var labelsBtn = document.getElementById('labels-toggle');
            var choroBtn = document.getElementById('choro-toggle');
            var playBtn = document.getElementById('play-toggle');
            var resetBtn = document.getElementById('reset-dma');

            slider.addEventListener('input', function() {
              var idx = parseInt(slider.value, 10);
              showWeek(idx);
            });

            if (labelsBtn) labelsBtn.addEventListener('click', function(){
              labelsOn = !labelsOn;
              labelsBtn.classList.toggle('active', labelsOn);
              showWeek(parseInt(slider.value,10));
            });

            if (choroBtn) choroBtn.addEventListener('click', function(){
              choroplethOn = !choroplethOn;
              choroBtn.classList.toggle('active', choroplethOn);
              showWeek(parseInt(slider.value,10));
            });

            if (playBtn) playBtn.addEventListener('click', function(){
              if (window._wk_autoplay_id) { clearInterval(window._wk_autoplay_id); window._wk_autoplay_id = null; playBtn.textContent = "Play"; }
              else {
                playBtn.textContent = "Pause";
                window._wk_autoplay_id = setInterval(function(){
                  var i = parseInt(slider.value,10);
                  i = (i + 1) % weekLabels.length;
                  slider.value = String(i);
                  showWeek(i);
                }, 1500);
              }
            });

            if (resetBtn) resetBtn.addEventListener('click', function(){
              selectedDMA = null;
              showWeek(parseInt(slider.value,10));
            });

            slider.value = "0";
            showWeek(0);
            
            if (!window._wk_autoplay_id) {
              playBtn.textContent = "Pause";
              window._wk_autoplay_id = setInterval(function(){
                var i = parseInt(slider.value,10);
                i = (i + 1) % weekLabels.length;
                slider.value = String(i);
                showWeek(i);
             }, 1500);
            }
          }
          initUI();
        } catch(e) {
          console.error("dynamic labels init error:", e);
        }
      }
      if (document.readyState === "complete") boot(); else window.addEventListener("load", boot);
    })();
    </script>
